import React from "react";
import styled from "styled-components";

const TextBlock = styled.div`
  font-family: kanit;
  font-size: 24px;
  line-height: 35px;
`;
function AboutEcMainText({ children }) {
  return <TextBlock>{children}</TextBlock>;
}

export default AboutEcMainText;
